                var html_2da93f3c74bc1ecdacc8f54eb3817d7e = $(`<div id="html_2da93f3c74bc1ecdacc8f54eb3817d7e" style="width: 100.0%; height: 100.0%;">             <div style="font-family: sans-serif; max-width: 280px;">                 <h4 style="margin:0 0 5px 0; color:#333;">Revesby Worker's Club</h4>                 <p style="margin:0 0 10px 0; font-style:italic; color:#555;">Cafe</p>                 <p style="margin:0;"><b>Rating:</b> 4.2 (3411.0 reviews)</p>                 <p style="margin:5px 0;"><b>Sentiment:</b> <span style="color: #28a745; font-weight:bold;">0.35</span></p>                 <div style="background: #e9ecef; border-radius: 5px; height: 10px; margin-top: 5px;">                     <div style="width: 67.54772727272727%; background: #28a745; height: 10px; border-radius: 5px;"></div>                 </div>                 <hr style="border:none; border-top: 1px solid #eee; margin:10px 0;">                 <p style="margin:0 0 5px 0;"><b>Top Review:</b></p>                 <div style="font-size: smaller; font-style: italic; color: #666; max-height: 60px; overflow-y: auto;">"Revesby Workers Club is a solid spot for a meal with great service and a clean, welcoming atmosphere. The staff were friendly and efficient, and the venue itself was well-maintained, making for a comfortable dining experience.  I ordered the schnitzel, which was impressively thick and juicy‚Äîdefinitely not one of those thin, dry ones you sometimes get. However, I was pretty disappointed to find out that gravy wasn‚Äôt included and cost an extra $2. It‚Äôs a small thing, but for a dish like schnitzel, gravy should be standard.  My friend went for the lamb shank, and I have to admit, I had a bit of food envy. It looked amazing, and he rated it a solid 5/5. Based on what I saw (and the way he demolished it), I‚Äôd have to agree.  Overall, it‚Äôs a great place with quality food, but the extra charge for gravy was a bit ridiculous. Would still come back, though‚Äîespecially for that lamb shank!"</div>             </div>             </div>`)[0];

                var html_31f7275dff2e7c6968f736f721063994 = $(`<div id="html_31f7275dff2e7c6968f736f721063994" style="width: 100.0%; height: 100.0%;">             <div style="font-family: sans-serif; max-width: 280px;">                 <h4 style="margin:0 0 5px 0; color:#333;">Bangor Tavern</h4>                 <p style="margin:0 0 10px 0; font-style:italic; color:#555;">Bar</p>                 <p style="margin:0;"><b>Rating:</b> 4.1 (664.0 reviews)</p>                 <p style="margin:5px 0;"><b>Sentiment:</b> <span style="color: #28a745; font-weight:bold;">0.20</span></p>                 <div style="background: #e9ecef; border-radius: 5px; height: 10px; margin-top: 5px;">                     <div style="width: 59.95610071207902%; background: #28a745; height: 10px; border-radius: 5px;"></div>                 </div>                 <hr style="border:none; border-top: 1px solid #eee; margin:10px 0;">                 <p style="margin:0 0 5px 0;"><b>Top Review:</b></p>                 <div style="font-size: smaller; font-style: italic; color: #666; max-height: 60px; overflow-y: auto;">"üåü Spent Mother's Day lunch at Roberto's inside Bangor Tavern, and while there were some highlights, our experience was a bit mixed.  We requested a table near the playground, hoping for a nice view while the kids played, but ended up inside, far away with no visibility. When the kids ran to the playground, they found it wet, leaving them with soaked clothes. It would be great if they could dry it off next time or at least put up a caution sign.  Although they promote themselves as family-friendly and offer free kids' meals on Sundays, it was quite unsettling to have UFC playing on the screens. With all the blood and gore, it wasn't the best environment for our little ones, and many nearby families shared the same concerns. Definitely not ideal for a Mother's Day lunch!  On a positive note, the renovations and new aesthetic looked lovely and have the potential for a nice vibe. The pappardelle pasta was a standout‚Äîdelicious with well-cooked, tender ragu topped with Parmesan! However, the prawn linguini was too chilli for our taste, and we didn't enjoy it.  The guys with us ordered schnitzels and thought they were average, though the portion sizes were generous. My sister tried the pumpkin ravioli and said it was nice. The kids had a cheeseburger and fish and chips, and they were great sizes and tasty, so our little ones were happy!  Overall, there's potential here, but they might want to rethink some aspects to make it more family-friendly.  #FoodReview #BangorTavern #Robertos #FamilyDining #SydneyEats #MothersDay #Foodie #RestaurantReview #KidsEatFree #SutherlandShire #InstaFood #FoodBlogger #FamilyFriendlyDining"</div>             </div>             </div>`)[0];

                var html_a2b97050337ba695d7bc164b5e294df7 = $(`<div id="html_a2b97050337ba695d7bc164b5e294df7" style="width: 100.0%; height: 100.0%;">             <div style="font-family: sans-serif; max-width: 280px;">                 <h4 style="margin:0 0 5px 0; color:#333;">LOAF Engadine</h4>                 <p style="margin:0 0 10px 0; font-style:italic; color:#555;">Restaurant</p>                 <p style="margin:0;"><b>Rating:</b> 4.8 (120.0 reviews)</p>                 <p style="margin:5px 0;"><b>Sentiment:</b> <span style="color: #28a745; font-weight:bold;">0.43</span></p>                 <div style="background: #e9ecef; border-radius: 5px; height: 10px; margin-top: 5px;">                     <div style="width: 71.4379149496337%; background: #28a745; height: 10px; border-radius: 5px;"></div>                 </div>                 <hr style="border:none; border-top: 1px solid #eee; margin:10px 0;">                 <p style="margin:0 0 5px 0;"><b>Top Review:</b></p>                 <div style="font-size: smaller; font-style: italic; color: #666; max-height: 60px; overflow-y: auto;">"We stumbled across this cozy little caf√© and were absolutely delighted with our experience. From the moment we walked in, the staff made us feel welcome, and the atmosphere was relaxed, charming, and just what we needed for a lazy morning.  We tried the Big Breakfast, the Pulled Beef Sandwich, and the ‚ÄúHangover Cure‚Äù Bacon and Egg Roll ‚Äî and every bite was incredible. The Big Breakfast was generous and beautifully cooked, with perfectly crispy bacon, poached eggs, a whole avocado, and all the classic trimmings. The Pulled Beef Sandwich was a standout ‚Äî rich, tender, and full of flavor, tucked into fresh bread with just the right amount of sauce. As for the ‚ÄúHangover Cure,‚Äù it definitely lived up to its name ‚Äî hearty, satisfying, and the perfect balance of salty, savory goodness.  The coffee was top-notch, too ‚Äî smooth, strong, and exactly how we like it. It‚Äôs clear that this caf√© takes pride in what they serve, and it shows in every detail.  Can‚Äôt wait to come back and try more of the menu. Highly recommend if you‚Äôre after great food, friendly service, and a spot that feels like a local favorite."</div>             </div>             </div>`)[0];

                var html_83b4dd47ae9b28fd1cf1e52fa4a3da7f = $(`<div id="html_83b4dd47ae9b28fd1cf1e52fa4a3da7f" style="width: 100.0%; height: 100.0%;">             <div style="font-family: sans-serif; max-width: 280px;">                 <h4 style="margin:0 0 5px 0; color:#333;">Big Red Cafe</h4>                 <p style="margin:0 0 10px 0; font-style:italic; color:#555;">Cafe</p>                 <p style="margin:0;"><b>Rating:</b> 4.8 (381.0 reviews)</p>                 <p style="margin:5px 0;"><b>Sentiment:</b> <span style="color: #28a745; font-weight:bold;">0.46</span></p>                 <div style="background: #e9ecef; border-radius: 5px; height: 10px; margin-top: 5px;">                     <div style="width: 73.16410973950303%; background: #28a745; height: 10px; border-radius: 5px;"></div>                 </div>                 <hr style="border:none; border-top: 1px solid #eee; margin:10px 0;">                 <p style="margin:0 0 5px 0;"><b>Top Review:</b></p>                 <div style="font-size: smaller; font-style: italic; color: #666; max-height: 60px; overflow-y: auto;">"A really good caf√© on the edge of Engadine centre.  Big Red has your standard Australian brunch food, all of which seems to be done to a good standard, but nothing that will blow your socks off. That said, the price definitely will, it's VERY cheap compared to most of Sutherland Shire!  Coffees were okay, but very milky for flat whites. A few sips in and you could barely taste the coffee. Takeout coffees in the past have been good though so this might have been a one off.  Service was friendly, but a little inattentive. We were there for an hour and nobody ever came out to tidy away what previous customers had left on the table.  There was a good amount of space outside thanks to the Cafe next door being closed when we visited (on a Saturday), and Big Red using some of their outdoor space. But this spot is always busy so I wouldn't count on always getting a table easily.  Highchairs were available, and there were good kids options. However, they brought the kids food out way later than the adults, which caused some predictable issues. I'd really recommend reversing that order.  Parking is available right outside on the street for an hour, and on/in various nearby streets and car parks for longer.  Overall a good spot, and somewhere we'll definitely be back to."</div>             </div>             </div>`)[0];

                var html_e7a2830ae10772a09a3e963d46ff5f1f = $(`<div id="html_e7a2830ae10772a09a3e963d46ff5f1f" style="width: 100.0%; height: 100.0%;">             <div style="font-family: sans-serif; max-width: 280px;">                 <h4 style="margin:0 0 5px 0; color:#333;">Sublime Point Cafe & Function Centre</h4>                 <p style="margin:0 0 10px 0; font-style:italic; color:#555;">Cafe</p>                 <p style="margin:0;"><b>Rating:</b> 4.2 (470.0 reviews)</p>                 <p style="margin:5px 0;"><b>Sentiment:</b> <span style="color: #28a745; font-weight:bold;">0.38</span></p>                 <div style="background: #e9ecef; border-radius: 5px; height: 10px; margin-top: 5px;">                     <div style="width: 68.8187273960217%; background: #28a745; height: 10px; border-radius: 5px;"></div>                 </div>                 <hr style="border:none; border-top: 1px solid #eee; margin:10px 0;">                 <p style="margin:0 0 5px 0;"><b>Top Review:</b></p>                 <div style="font-size: smaller; font-style: italic; color: #666; max-height: 60px; overflow-y: auto;">"Overview We had our wedding reception and Sublime Point Cafe in January 2020 and it was absolutely wonderful. The staff were really friendly and made sure we had everything we needed, the food was great and we felt really well looked after. It is a family run business and you really get that authentic down to Earth feel. They make you really feel like it‚Äôs a special day, unlike a wedding factory venue where you are just the next customer. Apart from the obvious amazing views and scenery, the big thing for us was being treated like humans with our own thoughts and interests rather than just another customer.  Staff: Alex who runs the place is really accommodating and really easy to get along with. We had some guest with some rather hard dietary requirements and he did an exemplary job at catering for our needs! Unfortunately I can‚Äôt remember the names of everyone but the young lady who also helped us plan out the fine details was lovely to work with. And there was a guy who managed the day and just did an absolutely amazing job. We told them prior to the day our concerns that we wanted to actually eat on our wedding day, etc and he made sure that it happened. He was really reliable, friendly and made sure we had everything whether it was some space to catch our breathe, a cup of tea, you name it he was on it. And on a whole the staff were really lovely to us and our guests!  Food: Honestly it was just amazing! We HIGHLY recommend the slow cooked beef brisket and the salmon! I mean everything that Alex cooks is incredible, for example my husband hates salmon and this is the only place where he actually enjoyed eating the salmon. Even our guests with dietary requirements loved their meals!! I mean seriously the food is second to none, you get amazing quality and a lot of it (especially if you go the buffet route which again really worth doing)!  Venue: There are lots of windows to show off the amazing view and I really mean amazing view! There is air conditioning if the temperature requires it (I assume it would also heat if needed). The fairy lights really are a must in our opinion (both inside and outside). We went for a really relaxed and minimalist theme for our reception but they really can cater to whatever you want. They have many accessories like a dance floor and outside games, they also have contacts for other accessories like photo booths and DJs, etc. Honestly if you could come up with something they don‚Äôt already have I have Alex is really accommodating so he would really try to make sure you could have it at the place. The seats are really comfortable and it can adapt to different themes really well (we saw a lovely rustic theme that they did for a wedding when checking out the venue for the first time). They even do ceremonies as well (although we had ours at a church). It sat about 106 people pretty comfortably and it by no means felt squished! There were talks about doing the speeches outside but due to the bushfire smoke we opted to go indoors (although it turned out to be a really lovely day with some light rain and no smoke).  Honestly we can‚Äôt speak highly enough of the lookout and the cafe. You really have to check it out especially for all you Sydney people who never drive down south! We shocked our guests with it and every single one of them agreed that it was worth the drive!"</div>             </div>             </div>`)[0];

hance to order I asked for one of the pale ales listed on the menu, sorry we don't do that any more (taps are way down the other end of the bar out of view) so I say ok no problems any pale ale you have on tap is fine. I was told by the bar worker "I don't know what pale ale is. I don't know beer". Kitchen ran out of all but 1 or 2 menu items halfway through the event with the bar also running out of drinks and kegs.  Look I could go on but what's the point, to sum it all up.  Inept bar staff Over priced under portioned food Condescending and petulant security  Basically I have been to venues run by people living with disabilities and have had better run experiences. You get one star because 0 isn't an option. Do better because you honestly can't do any worse"</div>             </div>             </div>`)[0];

nd drinks came out after the food ‚Äì some confusion between bar staff. It felt a bit chaotic, though service was friendly.  Would I return? Yes ‚Äì I‚Äôd definitely give it another go when I‚Äôm down that way again. I think with time and consistency, it could be a really fantastic venue.  The verdict: Great concept in a brilliant location with lots of potential. A few hiccups with service on the night, but still worth a visit if you‚Äôre in the area ‚Äì especially on a sunny day by the water."</div>             </div>             </div>`)[0];

                var html_a2cc2a91080ad60ea173c3af8574ce97 = $(`<div id="html_a2cc2a91080ad60ea173c3af8574ce97" style="width: 100.0%; height: 100.0%;">             <div style="font-family: sans-serif; max-width: 280px;">                 <h4 style="margin:0 0 5px 0; color:#333;">The Fish Shop</h4>                 <p style="margin:0 0 10px 0; font-style:italic; color:#555;">Restaurant</p>                 <p style="margin:0;"><b>Rating:</b> 4.5 (930.0 reviews)</p>                 <p style="margin:5px 0;"><b>Sentiment:</b> <span style="color: #28a745; font-weight:bold;">0.18</span></p>                 <div style="background: #e9ecef; border-radius: 5px; height: 10px; margin-top: 5px;">                     <div style="width: 59.228478835978834%; background: #28a745; height: 10px; border-radius: 5px;"></div>                 </div>                 <hr style="border:none; border-top: 1px solid #eee; margin:10px 0;">                 <p style="margin:0 0 5px 0;"><b>Top Review:</b></p>                 <div style="font-size: smaller; font-style: italic; color: #666; max-height: 60px; overflow-y: auto;">"Finding a good fish shop on a coastal holiday is essential.  While on the way to check out the Burrill Lake picnic areas on the other side of the bridge, we made a quick stop for lunch at The Fish Shop Burrill Lake adjacent to the highway.  Take way only, this shop is what it says on the sign - fish, chips and other related seafood. If you don't mind deep fried food, it is a worth a stop.  The ordering process is efficient - you get a ticket with a number. Even though they were busy just at the beginning of school holidays the wait was reasonable.  Our food was served in a cardboard tray inside a paper bag so full marks for plastic free packaging (except for the tartare sauce). In my view the the fish cocktails were rather ordinary however their version of salt and pepper squid was great. Good value for the price as they were large pieces. The chips were good old fashioned thick chips, nothing like Maccas fries. The chips were fabulous - well cooked and tasty.  If you are passing through and want to sit down to eat, walk a short distance towards Burrill Lake to the picnic tables with a pleasant view of Burrill Lake itself."</div>             </div>             </div>`)[0];

                var html_2aff5d5b7e6105ddfae6d1a08ee54e66 = $(`<div id="html_2aff5d5b7e6105ddfae6d1a08ee54e66" style="width: 100.0%; height: 100.0%;">             <div style="font-family: sans-serif; max-width: 280px;">                 <h4 style="margin:0 0 5px 0; color:#333;">Lagom Bakery</h4>                 <p style="margin:0 0 10px 0; font-style:italic; color:#555;">Bakery</p>                 <p style="margin:0;"><b>Rating:</b> 4.7 (259.0 reviews)</p>                 <p style="margin:5px 0;"><b>Sentiment:</b> <span style="color: #28a745; font-weight:bold;">0.36</span></p>                 <div style="background: #e9ecef; border-radius: 5px; height: 10px; margin-top: 5px;">                     <div style="width: 68.11190476190477%; background: #28a745; height: 10px; border-radius: 5px;"></div>                 </div>                 <hr style="border:none; border-top: 1px solid #eee; margin:10px 0;">                 <p style="margin:0 0 5px 0;"><b>Top Review:</b></p>                 <div style="font-size: smaller; font-style: italic; color: #666; max-height: 60px; overflow-y: auto;">"(4.5 stars) Lagom Bakery is the best bakery I‚Äôve tried in the Shoalhaven region. It‚Äôs located on a slip road in Burrill Lake, right near a good spot to buy local seafood. It‚Äôs hella popular, even on an icy morning when the feels like temperature was four degrees. The queue moved quickly though, and the shelves were well-supplied. They bake so many breads, they‚Äôre on a rotating roster, published on their website. The sourdough is slow fermented and easy to digest without being punishingly crusty. Try it on a well-priced Reuben ($11). It‚Äôs also well-balanced, tasting of cabbage and corned beef rather than an overload of cheese or too-much Russian dressing.  Meats and charcuterie are sourced from Martin‚Äôs Ridge Farm, just on the other side of Milton. The lonza (dry cured pork loin) is a standout on slabs of pizza ($6) with mushrooms and Reggiano. Savoury danishes are my weakness, so for breakfast I went straight for the mushroom and goat‚Äôs cheese danish ($7). The sweet range is also impressive, with some innovations, like a mango, cr√®me patisserie and macadamia crumble danish ($7) and a filled cruffin ($7) with an Italianate stuffing of ricotta, cr√®me patisserie and pistachio.  Coffees, by Guerrilla Roasters in Moruya, were good across a strong flat white ($5.80) and strong cappuccino ($5.80). The product range, both in the fridges and neatly arranged on blonde wood shelves, is also worth checking out. There are lots of locally sourced items, plus some imports that might be otherwise hard to find in the Shoalhaven area. We liked this bakery so much, we returned to take home pizza and Turkish rolls ($1.50/each) for lunch the next day."</div>             </div>             </div>`)[0];

                var html_22b5baac53d45159771e827ed37736e5 = $(`<div id="html_22b5baac53d45159771e827ed37736e5" style="width: 100.0%; height: 100.0%;">             <div style="font-family: sans-serif; max-width: 280px;">                 <h4 style="margin:0 0 5px 0; color:#333;">Na Siam Thai Restaurant</h4>                 <p style="margin:0 0 10px 0; font-style:italic; color:#555;">Restaurant</p>                 <p style="margin:0;"><b>Rating:</b> 3.9 (238.0 reviews)</p>                 <p style="margin:5px 0;"><b>Sentiment:</b> <span style="color: #6c757d; font-weight:bold;">0.08</span></p>                 <div style="background: #e9ecef; border-radius: 5px; height: 10px; margin-top: 5px;">                     <div style="width: 54.231626723057644%; background: #6c757d; height: 10px; border-radius: 5px;"></div>                 </div>                 <hr style="border:none; border-top: 1px solid #eee; margin:10px 0;">                 <p style="margin:0 0 5px 0;"><b>Top Review:</b></p>                 <div style="font-size: smaller; font-style: italic; color: #666; max-height: 60px; overflow-y: auto;">"Hmmmm... This is a difficult place to review.. To be honest, the food is fresh and quiet tasty. There is a good selection of traditional Thai cuisine. Mixed entre was good, but only good. Highlight are the fish cakes and Satay skewers.... Spring roll and puffs are meh!!! Phad Thai is good, but only good, and Green Peppercorn Calamari is amazing. The real issue is with the service and the delivery of the meals. Entrees came together... Excellent. Main,... Calamari came first... 5 minute, then the Phad Thai...but to top it off, we were finished our meals and about ready to leave when the Spicy fried rice came out. I suggested because we had finished that I might need a takeaway container. "Sure, they are 50c each" Haha... Sure... Why not??? Dishing it in to my 50c container, it was almost soupy.  I have had plenty of Thai Fried Rice's previously, none ever this wet. Breakfast the next morning and the Fried rice was average... Less than average actually. Was disappointing... And I don't mind leftover fried rice for breakfast (usually). This one was wet... And generally unpleasant... Even the next day (when they usually dry out a bit). There's not much to choose from for Thai in Narooma...my suggestion... If you want Thai... Keep Driving."</div>             </div>             </div>`)[0];

he chef‚Äôs signature dishes, was the pumpkin and sweet potato, with burnt butter with pine nuts ravioli, not a big meal but so worth what is on the plate! That burnt butter was absolutely downright Amazing! We got a bunch of different plates and we shared everything on our table. The trio dips and the fresh bread with that home made basil oil!! Hands down that was so tasty. The  lamb ragu was beautifully done. The crispy pork skin, can‚Äôt ever go wrong with that!! If you ever get a chance to go there, you must try their tiramisu!! If you love coffee, it‚Äôs a must. Thank you for letting us dine in this beautiful intimate restaurant. We look forward to coming and eating there again. Much love üòç"</div>             </div>             </div>`)[0];

                var html_841c18d79a3185f10f20c095bfbb4eac = $(`<div id="html_841c18d79a3185f10f20c095bfbb4eac" style="width: 100.0%; height: 100.0%;">             <div style="font-family: sans-serif; max-width: 280px;">                 <h4 style="margin:0 0 5px 0; color:#333;">McDonald's Morwell</h4>                 <p style="margin:0 0 10px 0; font-style:italic; color:#555;">Cafe</p>                 <p style="margin:0;"><b>Rating:</b> 3.4 (1634.0 reviews)</p>                 <p style="margin:5px 0;"><b>Sentiment:</b> <span style="color: #28a745; font-weight:bold;">0.15</span></p>                 <div style="background: #e9ecef; border-radius: 5px; height: 10px; margin-top: 5px;">                     <div style="width: 57.424450549450555%; background: #28a745; height: 10px; border-radius: 5px;"></div>                 </div>                 <hr style="border:none; border-top: 1px solid #eee; margin:10px 0;">                 <p style="margin:0 0 5px 0;"><b>Top Review:</b></p>                 <div style="font-size: smaller; font-style: italic; color: #666; max-height: 60px; overflow-y: auto;">"To preface the below, I used to work at this restaurant for many years.  Morwell McDonalds has a reputation for putting their metrics before the customers. For instance drive through has a goal time for customers to have their order taken and their food handed out. This timer finishes after the last window, meaning when you get sent to bay, the timer stops. This goes a long way to explain why you get sent to Bay even if you just ordered a cheeseburger.  Furthermore this incentivises corner cutting as experienced today and multiple mornings recently.  The breakfast menu has one common theme: muffins Muffins are great when toasted with their dedicated toasters, but downright awful when cooked in the standard bun toaster used for. The difference is equivalent to toast vs warmed bread. One is crisp and satisfyingly, the other is chewy and dense.  I would not be making this review if this was an isolated event, but it has been a common occurrence for me lately despite ordering during the regular breakfast period.  The service has always been adequate and nothing special, especially when it comes to drive through and baying cars.  The food is amazing when done right but hard to get through when not  Overall I will keep coming here, but I certainly wouldn't recommend the breakfast menu unless you're willing to roll the dice."</div>             </div>             </div>`)[0];

                var html_a83cbaee7640813f393dbe64db97c523 = $(`<div id="html_a83cbaee7640813f393dbe64db97c523" style="width: 100.0%; height: 100.0%;">             <div style="font-family: sans-serif; max-width: 280px;">                 <h4 style="margin:0 0 5px 0; color:#333;">Sombo bakery</h4>                 <p style="margin:0 0 10px 0; font-style:italic; color:#555;">Bakery</p>                 <p style="margin:0;"><b>Rating:</b> 4.4 (63.0 reviews)</p>                 <p style="margin:5px 0;"><b>Sentiment:</b> <span style="color: #28a745; font-weight:bold;">0.40</span></p>                 <div style="background: #e9ecef; border-radius: 5px; height: 10px; margin-top: 5px;">                     <div style="width: 69.83308982683982%; background: #28a745; height: 10px; border-radius: 5px;"></div>                 </div>                 <hr style="border:none; border-top: 1px solid #eee; margin:10px 0;">                 <p style="margin:0 0 5px 0;"><b>Top Review:</b></p>                 <div style="font-size: smaller; font-style: italic; color: #666; max-height: 60px; overflow-y: auto;">"Sombo Bakery is a five-star slice of country-town charm that feels like home from the moment you walk through the door. This is the kind of bakery where you can tell everything is made with care and a love for good, honest food.  The meat pies are absolutely sensational‚Äîflaky pastry encases a rich, hearty filling that hits all the right notes. What really sets this bakery apart, though, is the impressive variety of steak pies. From peppered steak to a creamy mushroom version, each pie is a masterpiece, showcasing a depth of flavor that rivals any city bakery.  As for the sweets? Both the lemon slice and vanilla slice deserve their own accolades. The lemon slice strikes the perfect balance between tangy and sweet, while the vanilla slice is a towering delight of creamy custard and crisp pastry. These slices aren‚Äôt just good‚Äîthey‚Äôre epic, and frankly, they should be award-winning. rved b) When it was served the the wait staff was confused about the table number to which I had to assure him it was in fact the order for table 4. c) The rice was undercooked, this made it hardly edible and most of it was left over. The Commercial has good potential but they do need to pay a little more attention to detail. I would not be ordering rice there again for sure. Overall, somewhat disappointed but has potential."</div>             </div>             </div>`)[0];
